import axios from 'axios';

const config = "localhost:8080";


export const signin = user => {
  return  axios.post(`https://jsonplaceholder.typicode.com/users`, { user })
  .then(res => {
    console.log(res);
    console.log(res.data);
  }).catch(err => {
    console.log("error", err)
  })
}
